window.bookSummaryJSON = "<p>Journey to the center of Tardoon...</p> <p>When a beloved friend is captured by centaurs, Braddock needs gold...fast. So he and a team of wives, friends, and mercenaries explore the dungeon beneath his home, hunting the Lost Treasure.</p> <p>But this deadly labyrinth is no mere dungeon.This is the Dragons' Conundrum, a 1,000-year-old test.</p> <p>Can Braddock become the next Master of Dragons?</p> <p><b>Warning: </b>This series contains adult themes, graphic violence, and a strong male protagonist with the rough and ready attitude of an American frontiersman. Listen at your own risk.</p>"; 
